    ''' ALT 3.3) proper in-place encoding'''
    def buildArray(self, nums: list[int]) -> list[int]:
        '''
        store both values in the same integer:
            encoded_value = old_value + n * new_value
        extract values: 
            old_value: encoded_value % n
            new_value: encoded_value // n
        since: "0 <= nums[i] < n"
        by adding: 'n*new_value' we store the new value to the "upper bits"
        old value: "lower bits"
        '''
        n = len(nums)

        # 1) encode values
        for i in range(n):
            nums[i] = nums[i] + n * (nums[nums[i] % n] % n) #"nums[nums[i] % n]"" does not work, this gets the original index, do "% n" again to get the original value
        
        # 2) extract values
        for i in range(n):
            nums[i] //= n
        return nums
        # return [nums[i] // n for i in range(n)]

    '''#* ALT 3.4) proper in-place encoding (cleaned)'''
    def buildArray(self, nums: list[int]) -> list[int]:
        n = len(nums) #although shouldnt n not be a variable if we want O(1)?
        for i in range(n):
            nums[i] = nums[i] + n * (nums[nums[i] % n] % n) #"nums[nums[i] % n]"" does not work, this gets the original index, do "% n" again to get the original value
        for i in range(n):
            nums[i] //= n
        return nums
        
